import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';

const LandingPage = () => {
  return (
    <div className="Landing-container">
      <h1 className="introduction">Hello There</h1>
      <Container>
  
        <Col xs={6} md={4}>
          <Image className="img-img" src="https://cdn.pixabay.com/photo/2023/04/23/06/00/ai-generated-7945042_640.jpg" rounded height="200px" width="500px"/>
        </Col>
    </Container>
    </div>
  )
}

export default LandingPage;
